import {Component} from "react";
import Control from './control';

class Main extends Component{
    constructor(props){
        super(props);
        //Values that get passed to the component

        this.tickerChange = this.tickerChange.bind(this);
        this.idChange = this.idChange.bind(this);
        this.skChange = this.skChange.bind(this);
        this.state = {
            key_id: 'PKHGR6CVRK7DTWFIB6Q1',
            secret_key: 'TpSauKJD8We5hu3vvXzwp2o7UrXBfR4uzxp4Z27n',
            ticker: 'TSLA',
        }
    }

    //#region Onchange functions
    tickerChange(value) {
        this.setState({ticker: value});
    }
    idChange(value) {
        this.setState({key_id: value});
    }
    skChange(value) {
        this.setState({secret_key: value});
    }
    //#endregion

    render(){
        return(
            <div>
                {this.state.ticker}
                <Control key_id={this.state.key_id} secret_key={this.state.secret_key} ticker={this.state.ticker} idChange={this.state.idChange} skChange={this.state.skChange} tickerChange={this.state.tickerChange}/>
            </div>
        )
    }
}

export default Main;
